n kadaghan kabuok. .pero ako gf kai naa na xa anak sa iya uyab sauna . . problema lang kai di sila magkita kaayo sa bata dugai2 napud xa wala na kita sa iya bata kai bz sya ya work..\r\n\r\n\r\nsalamat daan mga bro/sis :] ','2011-10-19 11:36:03'),(195,323,0,'Welcome to the club!!','2011-10-19 12:59:05'),(196,260,0,'naa ko prob mga pepz,,ani ni xa\r\ngalibog naku sa akoa sakyanan,dili man japon mu start oi bsag bag o ang bat,,mahal raba motolite maintenance free..unsaon mani oi bsag ag mekaniko galibog pod..,.hoooooo','2011-10-19 13:29:47'),(197,324,0,'Dear SlamAdvice,\r\n\r\nAko diay si Kevin, 30. Ang akong suliran mahitungod sa akong asawa nga hawod kaayo ka proud sa iyang educational attainment nga usahay maoy hinungdan nga mag-away mi kay mosamot man labi na og iya kong ingnon nga wala gani koy grado bisan college level ko, Papa Joe.\r\n\r\nHave something to report? Tell us in text, photos or videos.\r\n\r\nUsa ko ka supervisor sa usa ka dakong kompaniya diri sa Lapu lapu City unya siya usa ra ka sekretaya. Mao nga magkasukliay gyud mi og pulong kay di man sad ko magpalupig kay siya graduate pero mao ray iyang trabaho. Unya ra ba og mainsulto dayon og ingon nga maayo gani gipili ko niya. Pwede siya molarga abroad ug lingawlingaw ra niya iyang work kay bisan 30 na sad siya daghan pa kuno mokuha niya kay bright siya ug gwapa pa gyud.\r\n\r\nPero wa siya masayod ba nga sakitan baya ko kay feeling nako wa ko niya madawat labi na nga gamay ra sad akong sweldo bisan bisor ko. Usahay mo santop sa akong utok ang pagbuwag niya labi nga wala pa miy anak. Unsa kaha akong buhaton para mausab na ni siya. Naa pa kaha ni siyay chance mausab? Palihug tambagi ko.','2011-10-19 13:30:14'),(198,325,0,'walang problema na hindi nalulutas...andito na ang hari ng advice.....yeeeeaaaahhhhhhhh','2011-10-19 14:10:58'),(199,325,0,'dear slamadvice.\r\n    kahit ako ang hari ng advice,,may problema dn ako kagaya nyo,,hindi naman ako perpekto sa lahat ng bagay..kahit may mga kaso na mahirap lutasin ay nalulutas ko.///','2011-10-19 14:17:46'),(200,325,0,'natutulog pa yata ang mga may problema...huh','2011-10-19 21:53:34'),(201,325,0,'natutulog pa yata ang mga may problema...huh','2011-10-19 21:53:54'),(202,326,0,'Halu unsaon nako pag solbad sa akong problema...\r\nNa problema ko kay nganong wa koy problema.','2011-10-19 23:32:08'),(203,327,0,'Certain foods can boost your confidence.\r\n\r\nBy Maui Drilon for Yahoo! Southeast Asia\r\n\r\nWe all know that the sight of chocolate can make our hearts go pitter-patter. Or that the thought of a scoop of gelato can put a smile on our faces. But can certain foods actually give your self-esteem a boost? According to a study, the answer is yes!\r\n\r\nResearchers in McGill University in Montreal, Canada, found that food containing the amino acid tryptophan makes people more confident. Volunteers in the study who were given three grammes of tryptophan supplements said they felt more confident when in social situations. Thats because tryptophan boosts levels of serotonin, a chemical your brain produces that makes you feel relaxed and good about yourself. In fact, most anti-depressants work to boost serotonin levels in the body. This generally follows that heightened levels of serotonin in the body has anti-depressant effects. \r\n\r\nWith this new research, maybe its time you added some serotonin-boosting foods to your diet. Here are some you can add to your grocery list or order the next time youre out lunching with friends.\r\n\r\nTurkey is notorious for its tryptophan content. Why do you think people claim that they feel so relaxed after gorging on Thanksgiving turkey they fall asleep right after? Turkey is one of the best protein foods that boost serotonin levels. Its also rich in essential fats. The next time you hit the deli, consider getting yourself a turkey and cranberry sub!\r\n\r\nFatty Fish like salmon contain essential fats like DHA. Studies show that DHA alters the composition of nerve cell membranes, which in turn reduces depressive symptoms. Have a meal consisting of either salmon, sardines or mackerel three times a week if you can. If youre worried about mercury poisoning or cant stand the taste of fish, consider taking a fish oil supplement instead.\r\n\r\nGreen Leafy Veggies Popeye was onto something when he gobbled up spinach nonstop to stay healthy. Green leafy veggies such as spinach are high in folic acid. Studies show that the higher the folic acid in your body, the higher the serotonin present. You can get more folic acid by eating dried beans, almonds, nuts and lentils. \r\n\r\nBuckwheat This natural starch food contains the most tryptophan out of all the starchy carbs. The high levels of Vitamin B present in buckwheat are key to what makes this a great mood improver. Research shows that certain B vitamins help in proper serotonin synthesis in the brain. Dont be afraid youll be packing in on the calories just because this food is starch-based; you need to include a starchy carb that increases serotonin in your diet as this clears all other amino acids from your bloodstream, leaving only tryptophan to cross the blood-brain barrier. This then gets converted into serotonin. The trick is to eat starchy carbs in moderation. Pair a multi-grain piece of bread with some leftover roast chicken for lunch. The protein from the chicken helps create more serotonin.\r\n\r\nDark Chocolate You read that right  cocoa is well known to increase serotonin levels! The key is to buy dark chocolate that has a 70 per cent or higher cocoa content. Keep in mind: the darker the chocolate, the more anti-oxidants and polyphenols. Dont think this gives you the license to eat every chocolate bar in sight though. Chocolate bars are still high in sugar! While you may think those sweets are making you happy, your waist line surely wouldnt agree!','2011-10-19 23:46:10'),(204,324,0,'morning people! kinsay way problema dha kay atang hataga ug problema?\r\n','2011-10-20 00:46:51'),(205,63,0,'GOOD MORNING TO ALL,\r\n\r\nI ADDED UP TO 30 FRIENDS AND I RECEIVED 30 REGULAR LOAD. SALAMAT SA SlamAdvice.com and Vmobile downlines sa pagbigay ng load......\r\n\r\nI love slamAdvice.com','2011-10-20 00:54:19'),(206,332,0,'good morning :))','2011-10-20 00:56:05'),(207,332,0,'wa jud koy problema xo happy :))','2011-10-20 01:04:38'),(208,334,0,'Hello mga friends...Welcome diay sa slamAdvice.com...Naa moy mga problema dha? Post lang kay ready ko motambag sa inyong personal problems.Oh right. You can listen our fm program station 99.5 RT \\\"Talk to papa\\\"...Diosie....','2011-10-20 02:36:24'),(209,334,0,'Musta ka na dyan DETECTIVE CONAN? May tumawag sa akin humingi ng tulong sa iyo..nasan ka na? parang may krimen na nangyari doon..Lutasin muna yong problema conan. Go GO CONan','2011-10-20 02:43:59'),(214,335,0,'A pleasant day to you and to all the readers. I\\\'m one of your million readers. I am asking for your advice about my problem. It\\\'s about my lovelife. Just call me Mary Luna, 15. Naa koy nauyab nga taga Sibonga but diri siya nag-work sa Cebu as caretaker sa usa ka shop. Tagoa lang siya sa name nga Jeffrey, 26.\r\n\r\nMy problem is about my situation right now. I got pregnant and mag 5 months na akong tiyan. But just lately lang nako nahibaw-an. Ang nakapait, Papa Joe, kay taodtaod na mi nagkabuwag sa akong BF una nako nahibaw-an ang akong situation. Karon naproblema ko og maayo kay pwerteng sukoa sa akong parents pagkahibaw nila nga buntis ko ug nisamot pa gyud sila og kasuko pagkahibaw nila nga buwag na mi sa papa sa akong baby.\r\n\r\nUnsay akong dapat buhaton karon, Papa Joe? Dapat pa ba nako pahibaw-on ang papa sa akong baby? Ang akoa man gud, Papa Joe, kay naa na man gud siyay laing GF karon. Basig i-itsapwera ra ko niya kon moadto ko niya and makabungkag niya sad ko sa ilang relasyon. Please tambagi intawn ko kay naglibog na ko kon unsay dapat nakong buhaton. I feel so down and alone. Please don\\\'t print my e-mail add. I\\\'ll be waiting for your reply. More power and God bless. Thanks.','2011-10-20 05:02:15'),(215,339,0,'Hello world. Hello slamadvice...Im reggie from pasig city ,manila.....I just wanna find friends here and give some advice..','2011-10-20 06:08:09'),(216,340,0,'Hi slamAdvice.......im andee from Davao City.....have a nice day ahead','2011-10-20 06:19:09'),(217,340,0,'naa koy problem ug gusto ko mangayo ko ug advice ninyo..im 18 yrs old and i was pregnant:-(...wla mo angkon ang boyfriend nga iya ning anak..unsaon man ni nko? please i need your advice..i dont know what to do..','2011-10-20 06:23:43'),(218,341,0,'Maayong adlaw sa tanan....ako si sosima taga Leyte. ','2011-10-20 06:38:48'),(219,342,0,'Hi everyone:-) im milo everyday..from united states.but i understand visayan and tagalog bcoz i was born here in philippines @ cebu...im new in this site...hope we gonna stay here cool...','2011-10-20 07:00:46'),(220,342,0,'i love this site...i learned more about life situation....thanks to the developer of this site...COOL\r\n','2011-10-20 07:11:16'),(221,342,0,'i love this site...i learned more about life situation....thanks to the developer of this site...COOL\r\n','2011-10-20 07:11:50'),(222,317,0,'welcome sa tanan taga undernet lol\r\n','2011-10-20 08:10:47'),(223,344,0,'pagka.......','2011-10-20 08:18:25'),(224,345,0,'ayoooooooo.......naai taw?','2011-10-20 09:31:40'),(225,345,0,'naa d.i tig advice dri???.......pa advice ko bi..unsaon pg transform sa cat into dog...wakkekeke','2011-10-20 09:34:43'),(226,63,0,'meow meow meow','2011-10-20 11:24:31'),(227,346,0,'My next business venture will be GPRS..Every opportunity that comes lalo na at malaki ang kitaan di pinapalampas yan! Imagine a business with everything in it. From TICKETING (seafare and airfare), UTiLITy BILLS payment (post paid) sariling Bayad Center and MONEY REMITTANCE ..Plus Loading Business..ONLY from a very affordable starting capital..Wanna join my business venture ?!!! Just pm me in my Inbox and we\\\'ll make it BiG ..c,\\\") 